css:
.editor-colors {
  background-color: #222222;
  color: #cbcbcb;
}
.editor {
  background-color: #222222;
  color: #cbcbcb;
}
.editor .wrap-guide {
  background-color: #2d2d2d;
}
.editor .indent-guide {
  color: #252525;
}
.editor .invisible-character {
  color: #4e4e4e;
}
.editor .gutter {
  background-color: #222222;
  color: #4e4e4e;
}
.editor .gutter .line-number.cursor-line {
  background-color: #222222;
  color: #6e6e6e;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #6e6e6e;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #6e6e6e;
}
.editor .invisible {
  color: #cbcbcb;
}
.editor .cursor {
  color: #ffffff;
}
.editor .selection .region {
  background-color: #2f2f2f;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #6e6e6e;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #6e6e6e;
}
.entity.name.type {
  color: #f99157;
}
.entity.other.inherited-class {
  color: #99cc99;
}
.keyword {
  color: #cc99cc;
}
.keyword.control {
  color: #cc99cc;
}
.keyword.operator {
  color: #cbcbcb;
}
.keyword.other.special-method {
  color: #6699cc;
}
.keyword.other.unit {
  color: #ffcc66;
}
.storage {
  color: #f2777a;
}
.constant {
  color: #ffcc66;
}
.constant.character.escape {
  color: #66cccc;
}
.constant.numeric {
  color: #ffcc66;
}
.constant.other.color {
  color: #66cccc;
}
.constant.other.symbol {
  color: #99cc99;
}
.variable {
  color: #f2777a;
}
.variable.interpolation {
  color: #ee484c;
}
.variable.parameter.function {
  color: #cbcbcb;
}
.invalid.illegal {
  background-color: #f2777a;
  color: #222222;
}
.string {
  color: #99cc99;
}
.string.regexp {
  color: #66cccc;
}
.string.regexp .source.ruby.embedded {
  color: #ffcc66;
}
.string.other.link {
  color: #f2777a;
}
.punctuation.definition.comment {
  color: #6e6e6e;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #cbcbcb;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #6699cc;
}
.punctuation.definition.bold {
  color: #f99157;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #cc99cc;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #ee7b7e;
}
.support.class {
  color: #f99157;
}
.support.function {
  color: #66cccc;
}
.support.function.any-method {
  color: #6699cc;
}
.entity.name.function {
  color: #6699cc;
}
.entity.name.class,
.entity.name.type.class {
  color: #f99157;
}
.entity.name.section {
  color: #6699cc;
}
.entity.name.tag {
  color: #f2777a;
}
.entity.other.attribute-name {
  color: #ffcc66;
}
.entity.other.attribute-name.id {
  color: #6699cc;
}
.meta.class {
  color: #cbcbcb;
}
.meta.link {
  color: #ffcc66;
}
.meta.require {
  color: #6699cc;
}
.meta.selector {
  color: #cc99cc;
}
.meta.separator {
  background-color: #4e4e4e;
  color: #cbcbcb;
}
.none {
  color: #cbcbcb;
}
.markup.bold {
  color: #ffcc66;
  font-style: bold;
}
.markup.changed {
  color: #cc99cc;
}
.markup.deleted {
  color: #f2777a;
}
.markup.italic {
  color: #cc99cc;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #6699cc;
}
.markup.inserted {
  color: #99cc99;
}
.markup.list {
  color: #f2777a;
}
.markup.quote {
  color: #ffcc66;
}
.markup.raw.inline {
  color: #99cc99;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #99cc99;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
